import React from 'react';
import classes from './myposts.module.css'
import Post from '../../post/post'

let postsData = [
  { id: 1, message: 'Hello buddy!', likesCounts: 12 },
  { id: 2, message: 'What is your name?', likesCounts: 12 }
];

const MyPosts = (props) => {
    return (
      <div className={classes.wrapper}>
        <div>
          <h3>My posts</h3> <br></br>
          <textarea className={classes.Areal}></textarea>
          <br></br>
          <button>Add Post</button>
        </div>
        <div>
          <Post
            message={postsData[0].message}
            likesCounts={postsData[0].likesCounts}
          />
          <Post
            message={postsData[1].message}
            likesCounts={postsData[1].likesCounts}
          />
        </div>
      </div>
    );
}
export default MyPosts;
